	private static List<Station> routes;
	private static List<Transport> transports;
	private static List<Line> lines;
	
	@Override
	public List<Station> fetchRoutes() {
		if (routes == null) {
			routes = new ArrayList<Station>();
			for(int i=0; i < slat.length; i++){
				Station tmp = new Station(slat[i], slng[i], sname[i], sdir[i], slines[i], sdot[i], snears[i]);//, plat[i], plng[i], rname[i], rlines[i], lrase[i], ldots[i], lstops[i]);
				routes.add(tmp);
			}
		}
		return Collections.unmodifiableList(routes);
	}

	@Override
	public List<Transport> fetchTransports() {
		if (transports == null) {
			transports = new ArrayList<Transport>();
			for(int i=0; i < rname.length; i++){
				Transport tmp = new Transport(i,rlines[i],rname[i]);
				transports.add(tmp);
			}
		}
		return Collections.unmodifiableList(transports);
	}

	@Override
	public List<Line> fetchLines() {
		if (lines == null) {
			lines = new ArrayList<Line>();
			for(int i=0; i < lrase.length; i++){
				Line tmp = new Line(lrase[i], lstops[i]);
				lines.add(tmp);
			}
		}
		return Collections.unmodifiableList(lines);
	}

	
	
